import React from 'react';
import HarmonyGenerator from '../components/HarmonyGenerator';

const Home = () => {
  return (
    <section className='page home-page'>
      <h1>Welcome!</h1>

      <p>Check out our latest feature below!</p>
      <p>It generates actual color harmonies!</p>
      <HarmonyGenerator />
    </section>
  );
};

export default Home;
